// import Navbar from "./Landingpage/Navbar"
import ProductsOverview from "./Landingpage/ProductsOverview"
import Secondmenu from "./Landingpage/Secondmenu"
// import FakeNave from "./fakeNave"


export default function Home(){

    return(
        <div>
        {/* <Navbar /> */}
    
        <Banner />
        <Menu />
        <ProductsOverview />
        <Secondmenu /> 
         <Footer />
      
        </div>
    )
}
